import React from 'react';
import Work from './workTime';
import NonWork from './NonWorkTime';
import { NavLink } from 'react-router-dom';
const Home = ()=>{
    return(
        <>
        <h1>Restrictions</h1>
        <div className='row m-0'>
            
            <div className='col-12 mt-4'>
                <a className='btn btn-primary float-left ml-5 text-white'>Work Time</a>
                <a className='btn btn-light float-left text-white'>Non-Work Time</a>
            </div>
            <div className='col-12 mt-5'>
                    <Work/>
            </div>
        </div>
       
        </>
    )
}

export default Home
